import React from 'react';
import './UserBooks.css';

const UserBooks = ({ userBooks }) => {
  return (
    <div className="user-books-container">
      <h2>My Book List</h2>
      {userBooks.length === 0 ? (
        <p>No books in your list.</p>
      ) : (
        <div className="user-books-list">
          {userBooks.map((book) => (
            <div key={book.id} className="user-book-card">
              <img src={book.image_url} alt={book.title} className="user-book-card-image" />
              <h3>{book.title}</h3>
              <p>{book.author}</p>
              <p>Genre: {book.genre.genre}</p>
              <button>Remove from List</button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default UserBooks;
